from pydicom import dcmreadfrom tkinter import filedialogfrom tkinter import *root = Tk()root.withdraw()file_name = filedialog.askopenfilename()print("Selected file:", file_name)ds = dcmread(file_name)description = ds[0x0008103E]series_num = ds[0x00200011]description_value = str(vars(description)["_value"])series_num_value = str(vars(series_num)["_value"])print("Serie: " + series_num_value + "-" + description_value)# for element in ds:    # print(element)